export const PUT_REGISTER_DATA = 'PUT_REGISTER_DATA';
export const SEND_REGISTER_DATA = 'SEND_REGISTER_DATA';
export const SEND_AUTH_DATA = 'SIGN_IN';

export const putRegisterData = (payload) => {
  return {
    type: PUT_REGISTER_DATA,
    payload: payload
  };
}

export const sendRegisterData = (payload) => {
  return {
    type: SEND_REGISTER_DATA,
  };
}
